import React from 'react';
import './blogs.css';
import Header from '../header';
import Footer from '../footer';

export default function Blog() {
  return (
    <div>
      <Header />
      <div>
        <h1>The news that surrounds us is collected here</h1>
        <p></p>
      </div>
      <Footer />
    </div>
  );
}
